import React, { Component } from 'react';
import ReactTypingEffect from 'react-typing-effect';
import profilepic from '../img/MyPic.jpg';
import Social from '../components/Social'



class Home extends Component {
    render() {
        return (
            <div className="col-home">
            <img src={profilepic} className="profilepic"></img>
            <ReactTypingEffect className="typingeffect" text={['I am Zary Manning','Your next web developer!']} speed={100} eraseDelay={700}/>
            <Social />
            <p>
                <a>Creative Theme (default)</a>&bnsp
                <a>Canyon Theme</a>&bnsp
                <a>Cartoon Theme</a>&bnsp
                <a>Ink Theme</a>&bnsp
                <a>Lightstream Theme</a>&bnsp
                <a>Dark Green Theme</a>&bnsp
                <a>Geometric Theme</a>&bnsp
            </p>
            </div>
            )
        }
    }

export default Home
